import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './MenuPage.css';

const MenuPage = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [isAdmin, setIsAdmin] = useState(false);
  const [currentPlan, setCurrentPlan] = useState(null);
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');
  const handleLogout = () => {
    localStorage.removeItem('access');
    navigate('/');
  };
  const menuItems = [
    {
      id: 1,
      name: 'Basic Plan',
      price: '$10/month',
      plan_type: 'basic',
      features: ['10GB Storage', 'Basic Support', 'Limited Access']
    },
    {
      id: 2,
      name: 'Pro Plan',
      price: '$20/month',
      plan_type: 'pro',
      features: ['50GB Storage', '24/7 Support', 'Full Access']
    },
    {
      id: 3,
      name: 'Enterprise Plan',
      price: '$50/month',
      plan_type: 'enterprise',
      features: ['Unlimited Storage', 'Priority Support', 'Custom Solutions']
    }
  ];

  useEffect(() => {
    // Fetch user data
    fetch('http://localhost:8000/api/user/', {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('access')}`
      }
    })
    .then(res => res.json())
    .then(data => {
      setUser(data);
      setIsAdmin(data.is_staff);
    });
    
    

    // Fetch current subscription
    fetch('http://localhost:8000/api/user/subscriptions/', {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('access')}`
      }
    })
    .then(res => res.json())
    .then(data => {
      setCurrentPlan(data.active?.plan || null);
    });
  }, []);
  
  useEffect(() => {
    if (success) {
      const timer = setTimeout(() => {
        setSuccess('');
      }, 3000);
      return () => clearTimeout(timer); // Cleanup the timer
    }
  }, [success]);

  const handlePurchase = async (planType) => {
    try {
      console.log('Attempting to purchase plan:', planType); // Debug log
      
      const response = await fetch('http://localhost:8000/api/purchase-plan/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('access')}`,
          'Accept': 'application/json'
        },
        body: JSON.stringify({ plan: planType })
      });
  
      console.log('Response status:', response.status); // Debug log
  
      // Log the raw response
      const rawResponse = await response.text();
      console.log('Raw response:', rawResponse);
  
      const data = JSON.parse(rawResponse);
  
      if (!response.ok) {
        throw new Error(data.error || 'Failed to purchase plan');
      }
  
      setSuccess(`Successfully subscribed to ${data.plan}`);
      setCurrentPlan(data.plan);
    } catch (err) {
      console.error('Purchase error:', err); // Debug log
      setError(err.message);
    }
  };
  
return (
    <div className="page-wrapper">
      <nav className="navbar">
        <div className="nav-container">
          <div className="nav-brand">
            <img src={logo} alt="Logo" className="nav-logo hover-effect" onClick={() => navigate('/')} />
          </div>
          <div className="nav-links">
            <button 
              onClick={() => navigate('/about')}
              className="nav-link hover-effect"
            >
              About Us
            </button>
          </div>
        </div>
      </nav>

      <div className="login-container">
        <div className="login-card glass-effect">
          <div className="login-header">
            <h2 className="login-title">Welcome Back</h2>
            <p className="login-subtitle">Please enter your credentials to continue</p>
          </div>
          
          {error && <div className="login-error shake">{error}</div>}
          
          <form onSubmit={handleSubmit} className="login-form">
            <div className="input-group">
              <label htmlFor="username">Username</label>
              <input
                id="username"
                type="text"
                name="username"
                placeholder="Enter your username"
                value={formData.username}
                onChange={handleChange}
                className="login-input"
              />
            </div>
            
            <div className="input-group">
              <label htmlFor="password">Password</label>
              <input
                id="password"
                type="password"
                name="password"
                placeholder="Enter your password"
                value={formData.password}
                onChange={handleChange}
                className="login-input"
              />
            </div>

            <button type="submit" className="login-button pulse">
              Login
            </button>
          </form>

          <div className="login-footer">
            <button 
              onClick={() => navigate('/forgot-password')}
              className="forgot-password-link"
            >
              Forgot Password?
            </button>
            
            <div className="register-prompt">
              <span>Don't have an account?</span>
              <button 
                onClick={() => navigate('/register')}
                className="register-link"
              >
                Register here
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MenuPage;
